      debug: true,
      networkLogs: true,
    },
  },

  maxInstances: 10,

  updateJob: false,
  specs: ["./features/**/*.feature"],
  exclude: [],

  logLevel: "info",
  coloredLogs: true,
  screenshotPath: "./errorShots/",
  baseUrl: "",
  waitforTimeout: 99999,
  connectionRetryTimeout: 99999,
  connectionRetryCount: 3,

  framework: "cucumber",

  reporters: ["spec"],

  cucumberOpts: {
    require: ["./features/step-definitions/**/*.js"],
    backtrace: false,
    requireModule: [],
    dryRun: false,
    failFast: false,
    snippets: true,
    source: true,
    strict: false,
    tagExpression: "",
    timeout: 999999,
    ignoreUndefinedDefinitions: false,
  },
};

exports.config.capabilities.forEach(function (caps) {
  for (let key in exports.config.commonCapabilities)
    caps[key] = { ...caps[key], ...exports.config.commonCapabilities[key] };
});























